import React from 'react'
import ShortButtonCustomized from './ShortButton'


export default function TimelineComponent({header, description, image}) {
    return (
        <>
            <div>
                <h1>{header}</h1>
                <p>{description}</p>
                <ShortButtonCustomized />
            </div>
        </>
    )
}
